INSERT INTO Nahual (id,nombre,fechaInicio,fechaFinalizacion,rutaImagen,significado,descripcion) VALUE 
(1, "B'atz - Mono", '0001-01-01', '0001-01-01', "./src/gui/nahuales/1 batz.jpg", "HILO, EL DÍA DEL PRINCIPIO DE LA ENERGÍA, DEL TIEMPO Y DEL ESPACIO.", "Es el Nawal de todas las artes, de los tejidos, de los artistas. Es un día propicio para pedir pareja, amarrar o desatar cualquier asunto. Son maestros de todas las artes."),
(2, "E - Camino", '0001-01-01', '0001-01-01', "./src/gui/nahuales/2 e.jpg", "CAMINO, EL DÍA DEL CAMINO SAGRADO, EL DÍA DE LA ACCIÓN.", "Es el Nawal de todos los caminos y dirigentes. Del sistema nervioso y sanguíneo. Día propicio para iniciar cualquier viaje o negocio. Son líderes naturales."),
(3, "Aj – Hogar", '0001-01-01', '0001-01-01', "./src/gui/nahuales/3 aj.jpg", "CAÑA Y MILPA ES El DÍA DE LA ABUNDANCIA Y LA MULTIPLICACIÓN.", "Es el Nawal de la casa y de los niños, día propicio para el hogar y la salud de los niños.	Nawal de las generaciones tiernas.	Personas que no pueden negarse ante otros."),
(4, "I'x – Madre Tierra", '0001-01-01', '0001-01-01', "./src/gui/nahuales/4 ix.jpg", "MUJER Y JAGUAR, EL DIA DE LA MADRE TIERRA, LA MADRE NATURALEZA Y LA LUNA.", "Es el Nawal de la naturaleza y los altares mayas, día para pedir fortaleza física y mental. Es el Nawal de las siete vergüenzas humanas: orgullo, ambición, envidia, mentira, crimen, ingratitud, ignorancia por pereza. Personas de razonamiento interno a las que les gusta la naturaleza y la soledad."),
(5, "Tz'ikin - Pájaro", '0001-01-01', '0001-01-01', "./src/gui/nahuales/5 tzikin.jpg", "AGUILA, El DÍA DE LA RIQUEZA Y LA BUENA FORTUNA, EL DÍA DE LA VISIÓN.", "Es el Nawal del bienestar económico, la buena fortuna, día propicio para agradecer y pedir el bienestar económico. Es la comunicación e intermediación entre Uk´ux Kaj y Uk´ux Ulew, el corazón del cielo y el corazón de la tierra. Personas que construyen su propio bienestar."),
(6, "Ajmaq – Pecador", '0001-01-01', '0001-01-01', "./src/gui/nahuales/6 ajmaq.jpg", "PECADO, ES EL DÍA PARA DAR Y PEDIR PERDÓN POR TODOS LOS PECADOS ANTE EL AJAW.", "Es el Nawal de todas las faltas, es el día de los abuelos que ya no están (difuntos). Es el día para pedir perdón por las faltas. Personas valientes y de sangre dulce que  fácilmente caen en culpas."),
(7, "No'j – Sabiduría", '0001-01-01', '0001-01-01', "./src/gui/nahuales/7 noj.jpg", "SABIDURÍA, ES EL DÍA DEL CONOCIMIENTO Y LA INTELEGNECIA, EL DÍA DE LA CIENCIA.", "Es el Nawal de la inteligencia, día dedicado a pedir la sabiduría, el talento, el buen pensamiento. Es el Nawal del temblor o sismo. Personas muy creativas e imaginativas."),
(8, "Tijax – Piedra", '0001-01-01', '0001-01-01', "./src/gui/nahuales/8 tijax.jpg", "CUCHILLO DE DOBLE FILO, EL DÍA QUE CORTA TODO LO NEGATIVO.", "Nawal de la muerte repentina y los sufrimientos. Día propicio para curanderos y autoridades,  para cortar males y enfermedades. Personas confrontativas que cortan toda clase de males y problemas."),
(9, "Kawoq – Relámpago", '0001-01-01', '0001-01-01', "./src/gui/nahuales/9 kawoq.jpg", "RAYO DIVINO, EL DÍA DE LA ABUNDANCIA PARA LA FAMILIA.", "Es el Nawal de toda clase de pleitos, es el día de la mujer,  día para curar enfermedades. Nawal de la piedra de cuarzo y de las semillas de Tz´ité. Personas creativas, defensoras de la mujer."),
(10, "Ajpu – Luz", '0001-01-01', '0001-01-01', "./src/gui/nahuales/10 ajpu.jpg", "GUERRERO, ES EL DÍA DEL GRAN AJAW, EL DÍA DEL SEÑOR, EL DÍA DEL LÍDER.", "Es el Nawal de sol, día para pedir sabiduría, talento y fortaleza física. Nawal de las flores, la  música, el deporte,  los cazadores y la agricultura. Personas líderes, selectivas, buscan primero su beneficio."),
(11, "Imox – Pez", '0001-01-01', '0001-01-01', "./src/gui/nahuales/11 imox.jpg", "IZQUIERDA, ES EL DÍA DEL AGUA, DEL CAMBIO Y DEL PODER ESPÍRITUAL SOBRENATURAL.", "Es el Nawal del mar, ríos y lagos, día para sanar enfermedades de la mente, para agradecer y pedir la lluvia, enfermedades de la mente. El Nawal de todos los lugares donde está el agua. No es el concepto de locura que conocemos comúnmente,  es la capacidad de sentir lo que otros no sienten, por eso dicen que  hablan locuras."),
(12, "Iq' - Viento", '0001-01-01', '0001-01-01', "./src/gui/nahuales/12 iq.jpg", "LUNA EL DÍA DEL AIRE CRISTALINO Y DEL OXÍGENO.", "Es el Nawal del aire y la luna, del espíritu del ser humano. Día para alejar energías malas y enfermedades. Es el viento que limpia nuestra casa y nuestro cuerpo. Personas nobles que se involucran en los problemas de otros fácilmente. Van y vienen de un lugar a otro, como el viento."),
(13, "Aq'ab'al - Amanecer", '0001-01-01', '0001-01-01', "./src/gui/nahuales/13 aqabal.jpg", "DÍA Y NOCHE, EL DÍA DEL KIEB´AWIL (POLARIDAD), EL DÍA DE LA BENDICIÓN.", "Es el Nawal de la claridad, día para pedir que salga la luz en todas las cosas. El día de las personas que componen los huesos de los enfermos y de los curanderos con plantas. Personas que cumplen sus compromisos."),
(14, "K'at - Red", '0001-01-01', '0001-01-01', "./src/gui/nahuales/14 kat.jpg", "RED, EL DIA DE AGRUPAR, EL DIA DE REUNIR EN ABUNDANCIA.", "Es el Nawal de las cárceles visibles e invisibles. Es guardador. Representa la red donde se guarda el  maíz y donde se atrapan los peces. Día para pedir por los que están presos, para enredar y desenredar las cosas. Personas con mucho fuego en su ser.  Manejan energías positivas y negativas."),
(15, "Kan – Movimiento", '0001-01-01', '0001-01-01', "./src/gui/nahuales/15 kan.jpg", "SERPIENTE Y QUETZAL, EL DÍA DE NUESTRA GALAXIA, LA VITALIDAD Y DEL FUEGO INTERNO.", "Significa serpiente emplumada. Es el Nawal de la creación del hombre y la mujer. Es el dueño de todas las cosas materiales.  Día para pedir solución a toda clase de problemas y necesidades. Personas con un alto sentido de la lealtad."),
(16, "Kame – Tecolote", '0001-01-01', '0001-01-01', "./src/gui/nahuales/16 kame.jpg", "NACER Y MORIR, EL DÍA DE LOS CICLOS DE LA VIDA Y LA GENETICA.", "Es el Nawal de toda clase de muertes, día para pedir que se aleje la muerte. Se pide el descanso y  paz de un moribundo. La Muerte no es mala,  es el complemento de la vida, el descanso. Es el día para retirar energías negativas en las personas. Personas con habilidad para las artes y oficios."),
(17, "Kej – Venado", '0001-01-01', '0001-01-01', "./src/gui/nahuales/17 kej.jpg", "VENADO, EL DÍA DE LOS 4 PUNTOS CARDINALES, EL DÍA DEL BALANCE.", "Es el nawal de toda clase de animales cuadrúpedos. Día para pedir fuerza para cargar con nuestras penas. Nawal de las cuatro esquinas del mundo. Día de los Ajqíjab´ o sacerdotes mayas. Personas líderes, dominantes con su pareja, les gusta la fama."),
(18, "Q'anil – Semilla", '0001-01-01', '0001-01-01', "./src/gui/nahuales/18 qanil.jpg", "SEMILLA, EL DÍA DE LA SEMILLA DE LA VIDA Y LOS FRUTOS.", "Es el Nawal de toda clase de semillas animales y vegetales. Día de la fertilidad y las cosechas,  propicio para iniciar cualquier siembra o negocio. Significa los cuatro colores del maíz,  rojo, negro, blanco y amarillo. Personas de mano ¨caliente¨ a quienes todo lo que siembran les florece."),
(19, "Toj – Ofrenda", '0001-01-01', '0001-01-01', "./src/gui/nahuales/19 toj.jpg", "PAGO, EL DÍA DE LOS PAGAMIENTOS Y LA LIBERACIÓN DEL PASADO.", "Es el Nawal de los cuatro señores del fuego,  Tojil, Awilix, Jakawitz´ y  Nikajtakaj. Día propicio para nivelar o pagar cualquier deuda. Día en que se agradece todo lo que recibimos en nuestra vida,  lo bueno y lo malo. Personas con mucha sensibilidad para las artes y que lloran con facilidad"),
(20, "Tz'i' – Tepezcuintle", '0001-01-01', '0001-01-01', "./src/gui/nahuales/20 tzi.jpg", "PERRO, EL DÍA DE LA JUSTICIA, EL DÍA DEL EQUILIBRIO DE LA LEY MATERIAL Y ESPIRITUAL.", "Es el Nawal de la justicia, la autoridad material y espiritual, el orden. Día para pedir la solución a los problemas ante los tribunales. Día para  alejar los vicios. Son las personas que hablan por otros.  Los dueños de las leyes. Juzgan a los demás.");